import styled from "./About.module.css"

const About = ()=>{
    return (
        <div className={styled.container}>
        <h1>¡Bienvenidos a mi página de Rick & Morty!</h1>
        <p>¡Hola a todos! Bienvenidos al proyecto integrador de Nadia Armani para Soy Henry. </p>
        <p>Esta página fue creada aplicando los conocimientos adquiridos a lo largo del aprendizaje sobre React y Redux.</p>

        <h2>Próximo Módulo... ¡BackEnd!</h2>
        </div>
    )
}
export default About
